import './Test.css'

import { Col, Container, Row } from "react-bootstrap";

import Page from './components/Page/Page';
import Average from './components/AverageGoals/Average';

function Test(){
    return(
        <div>
            <Container fluid>
                <Row className='g-1'>
                    <Col xl = "4" lg = "6" md = "6" sm = "12"><Page></Page></Col>
                    <Col xl = "4" lg = "6" md = "6" sm = "12"><Average></Average></Col>
                    <Col xl = "4" lg = "6" md = "6" sm = "12"></Col>
                </Row>
            </Container>
        </div>
    )
}

export default Test
